import React from 'react';
import Header from './Header';

function KojiroPage() {
  return (
    <div>
      <Header />
      <div style={styles.container}>
        <h1 style={styles.heading}>Kojiro Miura</h1>
        <div style={styles.classInfo}>
          <p>Software Engineering class SFSU</p>
          <p>Fall 2025</p>
          <p>Section 01</p>
          <p>Team 8</p>
        </div>
      </div>
    </div>
  );
}

const styles = {
  container: {
    maxWidth: '1200px',
    margin: '0 auto',
    padding: '20px',
  },
  classInfo: {
    textAlign: 'center',
    margin: '20px 0',
    fontSize: '18px',
    lineHeight: '1.6',
  },
  heading: {
    color: '#333',
    textAlign: 'center',
    paddingBottom: '3px',
    borderBottom: '4px solid #9A2250',
    display: 'block',
    margin: '20px auto',
    fontSize: '45px',
    fontWeight: '600',
    width: 'fit-content',
  },
};

export default KojiroPage;
